CREATE TABLE Orders(
	order_id VARCHAR(255) NOT NULL PRIMARY KEY,
    user_id VARCHAR(255),
    product_id VARCHAR(255),
    quantity BIGINT,
    FOREIGN KEY (user_id) REFERENCES Cart(user_id),
    FOREIGN KEY (product_id) REFERENCES Cart(product_id),
    delivery_address VARCHAR(255),
    total_cost float(2)
);

